import React, { useState, useEffect } from "react";
import axios from 'axios'
import { useHistory } from 'react-router';
const Cars = () => {
    function getCookie(name) {
        var cookieValue = null;
        if (document.cookie && document.cookie !== '') {
            var cookies = document.cookie.split(';');
            for (var i = 0; i < cookies.length; i++) {
                var cookie = jQuery.trim(cookies[i]);
                if (cookie.substring(0, name.length + 1) === (name + '=')) {
                    cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
                    break;
                }
            }
        }
        return cookieValue;
    }

    const [cars, seteCars] = useState([])
    const history = useHistory()

    const getCars = async () => {
        const response = await axios.get('http://127.0.0.1:8000/list/')
        seteCars(response.data)



    }
    useEffect(() => {
        getCars();

    })





    return (

        <div>

            <h1 className='title'> Cars List</h1>


            <div class="row">
                {
                    cars.map((car, index) => (

                        <div className="container">
                            <div class="col-sm col-xs-12">

                                <div key={index} >

        <div class="col-sm-3">
            <div class="card">
            <img src={car.image} alt="car" style={{ height: "200", width: "200" }} className="card-img-top" />
                <div class="card-block">
                <h2>{car.model}</h2>
                                            <h4> {car.serie}</h4>                    <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                    <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                </div>
            </div>
        </div>
                                    <div className="card " >
                                        <div className="card-body">

                                            <p className="card-text"> Price: {car.price}</p>
                                            <p className="card-text ">Year: {car.year}</p>
                                            <p className="card-text">Date creation Pub: {car.date}</p>
                                            <p className="card-text">Dscription: {car.description}</p>
                                            <p><a className="btn btn-secondary" href="#" role="button">View details &raquo;</a></p>

                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>


                    ))
                }
            </div>

        </div>


    );

};
export default Cars;
